--
-- Triggers `web_attendance`
--
DELIMITER $$
CREATE TRIGGER `updateweekcount_trigger_web` BEFORE INSERT ON `web_attendance` FOR EACH ROW BEGIN
    SET NEW.week_ = (
        SELECT IFNULL(MAX(week_) + 1, 1)
        FROM web_attendance
        WHERE ID = NEW.ID
        AND YEARWEEK(date_) = YEARWEEK(NEW.date_)
    );
END
$$
DELIMITER ;

